import React, { Component } from 'react';
import { Apps, Container, MainTitle, BtnToggle, BtnChange } from './style.js';

import StatesPrice from './StatesPrice';

class App extends Component {
	render() {
		return (
			<div className="App">
				<Container>
					<h1>Our Pricing</h1>
					<div className="switch">
						<span className="btn" data-switch=".annually">
							Annually
						</span>
						<input type="checkbox" id="toggle" onChange={showTarget} ref={inputEl} />
						<label htmlFor="toggle">
							<div className="ball" />
						</label>
						<span className="btn" data-switch=".monthly">
							Monthly
						</span>
					</div>
					<ImgFloat />
					<Monthly />
					<Annually />

					<StatesPrice />
				</Container>
			</div>
		);
	}
}

export default App;
